import React, { useState } from 'react';
import {
	Container,
	Paper,
	TextField,
	Button,
	Typography,
	FormControl,
	InputLabel,
	Select,
	MenuItem,
	Alert,
	Box,
} from '@mui/material';
import { DateTimePicker } from '@mui/lab';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';

function Booking() {
	const [formData, setFormData] = useState({
		treatment: '',
		appointmentTime: null,
		notes: '',
	});
	const [error, setError] = useState('');
	const [success, setSuccess] = useState('');

	const handleSubmit = async (e) => {
		e.preventDefault();
		try {
			const response = await fetch('/api/appointments', {
				method: 'POST',
				headers: {
					'Content-Type': 'application/json',
					Authorization: `Bearer ${localStorage.getItem('token')}`,
				},
				body: JSON.stringify(formData),
			});

			const data = await response.json();

			if (response.ok) {
				setSuccess('Appointment booked successfully!');
				setFormData({
					treatment: '',
					appointmentTime: null,
					notes: '',
				});
			} else {
				setError(data.message);
			}
		} catch (err) {
			setError('An error occurred. Please try again.');
		}
	};

	return (
		<Container maxWidth="sm">
			<Paper elevation={3} sx={{ p: 4, mt: 4 }}>
				<Typography variant="h4" component="h1" gutterBottom>
					Book an Appointment
				</Typography>

				{error && (
					<Alert severity="error" sx={{ mb: 2 }}>
						{error}
					</Alert>
				)}
				{success && (
					<Alert severity="success" sx={{ mb: 2 }}>
						{success}
					</Alert>
				)}

				<Box component="form" onSubmit={handleSubmit}>
					<FormControl fullWidth sx={{ mb: 2 }}>
						<InputLabel>Treatment Type</InputLabel>
						<Select
							value={formData.treatment}
							label="Treatment Type"
							onChange={(e) =>
								setFormData({ ...formData, treatment: e.target.value })
							}
							required
						>
							<MenuItem value="General Checkup">General Checkup</MenuItem>
							<MenuItem value="Dental Care">Dental Care</MenuItem>
							<MenuItem value="Physiotherapy">Physiotherapy</MenuItem>
						</Select>
					</FormControl>

					<LocalizationProvider dateAdapter={AdapterDateFns}>
						<DateTimePicker
							label="Appointment Time"
							value={formData.appointmentTime}
							onChange={(newValue) =>
								setFormData({ ...formData, appointmentTime: newValue })
							}
							renderInput={(params) => (
								<TextField {...params} fullWidth sx={{ mb: 2 }} required />
							)}
							minDate={new Date()}
							minutesStep={30}
						/>
					</LocalizationProvider>

					<TextField
						fullWidth
						multiline
						rows={4}
						label="Notes"
						value={formData.notes}
						onChange={(e) =>
							setFormData({ ...formData, notes: e.target.value })
						}
						sx={{ mb: 2 }}
					/>

					<Button
						type="submit"
						variant="contained"
						color="primary"
						fullWidth
						size="large"
					>
						Book Appointment
					</Button>
				</Box>
			</Paper>
		</Container>
	);
}

export default Booking;
